import React from "react";
import colors from "tailwindcss/colors";

const Footer = () => {
  return (
    <div className="">



      <nav>

        {/* Mobile Responsive */}
        <div className="hidden">
          <div className="relative">
            <img className="w-full" src="Header mobile version-01 1.png" />
            {/* <img src="Header 02-01-01 1.png" /> */}
          </div>

          <div>

          </div>

          <div className="flex space-x-3 justify-center">
            <button className="text-white py-2 px-4 rounded-sm font-medium" style={{ "backgroundColor": "#2695FF", }}>Search Auction</button>
            <button className="text-white py-2 px-4 rounded-sm font-medium" style={{ "backgroundColor": "#F8B234", "color": "#BA0C26" }}>Search Auction</button>
          </div>



        </div>


        {/* Desktop Responcive */}
        <div className="">
          {/* Icon /Contact */}
          <div className="px-8 py-2 flex justify-between">
                <div className="flex space-x-2">
                  <img className="w-6 h-6" src="facebook.png" />
                  <img className="w-6 h-6" src="instagram.png" />
                  <img className="w-6 h-6" src="Group (2).png" />
                  <img className="w-6 h-6" src="twitter.png" />
                </div>

                <div>
                  <img src="office.png" />
                </div>

          </div>





          <div className="relative">
            <img src="Header 02-01-01 1.png" />
          </div>

        </div>


      </nav>







    </div>
  );
};

export default Footer;
